pragma solidity >=0.4.21 <0.7.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
//mad props to the crypto zombies tutorial!  Thanks!
contract AngelTokenManifestation is ERC721{
  using SafeMath for uint256;
  using Address for address;
  using Counters for Counters.Counter;
  // event emitted when AngelTokens are made. - anyone in the world can see that an Angel is on an Endeavor!
  /* Counters.Counter private _tokenIds; */
  /* State variables are stored in the blockchain */
  uint256 iddig = 16;
  uint256 idmod = 10 ** iddig;
  struct AngelToken {
    string name;  // name of the Angels endeavor
     string symbol;
      uint256 id;     //token identifier
       uint256 issue_num; // the token number out of the total supply expressed as a fraction
        uint256 _mint_date; // the date the Angel minted the particular issuance
    /* string status;  // the status of the contract
        string product; // the unit product being produced in the endeavor - a lb of coffee, a chocalate bar, a bar of soap, a board, solar panel, or your grandmas comfy undies
         string cost; // the Unit Retail Cost of your product
          string angel_coefficient; // coefficient of next round's profits
     */
  }
  AngelToken[] angel_tokens;
  event ManifestedAngelToken(
       string _name,
        string _symbol,
         uint256 _id,
          uint256 issue_num,
           uint256 _mint_date
         );
  constructor()
   ERC721("AngelToken", "ANGEL") public {  //setup <-- run once like an init <-- pass in name and symbol as per ERC721 Standard
  }
  //create new Angel Token
  function _tokenGenesis (
    string memory _name,
     string memory _symbol,
      uint256 _id,
       uint256 _issue_num,
         uint256 _mint_date
       /* string memory _status,
        string memory _product,
         string memory _cost,
          string memory _angel_coefficient,
            */
            ) private {
    angel_tokens.push( AngelToken(
        _name,
         _symbol,
          _id,
           _issue_num,
            _mint_date
           /* _status,
            _product,
             _cost,
              _angel_coefficient
               */
                )
      );
    emit ManifestedAngelToken(
           _name,
            _symbol,
             _id,
              _issue_num,
               _mint_date
               );
  }
  // generate random id
  function _idGenesis(string memory _str) private view returns (uint256) {
    uint256 id = uint256(keccak256(abi.encodePacked(_str)));
    return id % idmod;
  }
  // use id and passed in information to manifest an AngelToken
  function manifestAngelToken(
    string memory _name,
     string memory _symbol,
      uint256 _issue_num,
       uint256 _mint_date
      /* string memory _status,
       string memory _product,
        string memory _cost,
         string memory _angel_coefficient,
            */
    ) public {
      uint256 _id = _idGenesis(_name);
      _tokenGenesis(
        _name,
         _symbol,
          _id,
           _issue_num,
            _mint_date
           /* _status,
            _product,
             _cost,
              _angel_coefficient,
               _mint_date,
               */
                );
  }
}
